window.bookSummaryJSON = "<p><b>Discover the Graceling Realm in this unforgettable, award-winning novel from bestselling author Kristin Cashore.</b></p> <p><b>A </b><b><i>New York Times</i></b><b> bestseller * ALA Best Book for Young Adults * Mythopoeic Fantasy Award for Children's Literature Winner * </b><b><i>Publishers Weekly</i></b><b>, </b><b><i>School Library Journal, Booklist, </i></b><b>and </b><b><i>BCCB</i></b><b> Best Book of the Year</b></p> <p>“Rageful, exhilarating, wistful in turns\" (<i>New York Times Book Review) </i>with “a knee weakening romance” (<i>Los Angeles Times</i>). <i>Graceling</i> is a thrilling, action-packed fantasy adventure that will resonate deeply with anyone trying to find their way in the world.</p> <p><i>Graceling</i> tells the story of the vulnerable-yet-strong Katsa, who is smart and beautiful and lives in the Seven Kingdoms where selected people are born with a Grace, a special talent that can be anything at all. Katsa’s Grace is killing.</p> <p>As the king’s niece, she is forced to use her extreme skills as his brutal enforcer. Until the day she meets Prince Po, who is Graced with combat skills, and Katsa’s life begins to change. She never expects to become Po’s friend. She never expects to learn a new truth about her own Grace—or about a terrible secret that lies hidden far away . . . a secret that could destroy all seven kingdoms with words alone<i>.</i></p> <p>And don’t miss the sequel, <i>Fire,</i> and companion, <i>Bitterblue</i>, both award-winning <i>New York Times</i> bestsellers featuring Kristin Cashore’s elegant, evocative prose and unforgettable characters.</p> <ul> <li><b>ALA Best Book for Young Adults</b></li> <li><b>Mythopoeic Fantasy Award for Children's Literature Winner</b></li> <li><b><i>Publishers Weekly</i></b><b>, </b><b><i>School Library Journal, Booklist, </i></b><b>and </b><b><i>BCCB</i></b><b> Best Book of the Year</b></li> </ul>"; 
